[{"location":"api/#API","page":"API","title":"API","text":"","category":"section"},{"location":"api/#Modules","page":"API","title":"Modules","text":"Order = [:module]","category":"section"},{"location":"api/#Types-and-constants","page":"API","title":"Types and constants","text":"Order = [:type, :constant]","category":"section"},{"location":"api/#Functions-and-macros","page":"API","title":"Functions and macros","text":"Order = [:macro, :function]","category":"section"},{"location":"api/#Documentation","page":"API","title":"Documentation","text":"","category":"section"},{"location":"api/#NestedNumbers.NestedNumbers","page":"API","title":"NestedNumbers.NestedNumbers","text":"NestedNumbers\n\nNumbers that kind of contain numbers.\n\n\n\n\n\n","category":"module"},{"location":"api/#NestedNumbers.BareNumber","page":"API","title":"NestedNumbers.BareNumber","text":"abstract type BareNumber{T<:Number} end\n\nSuper-type for numbers do not have a unit or similar \"decoration\".\n\n\n\n\n\n","category":"type"},{"location":"api/#NestedNumbers.NestedNumber","page":"API","title":"NestedNumbers.NestedNumber","text":"abstract type NestedNumber{T<:Number} end\n\nSuper-type for numbers that contain another number of type T, directly or semantically.\n\nThe value of the inner number may or may not be directly accessible, and may or may not have a unit or similar, depending of the subtype of NestedNumber.\n\nExamples include opaque numbers, quantities with units, etc.\n\n\n\n\n\n","category":"type"},{"location":"api/#NestedNumbers.OpaqueNumber","page":"API","title":"NestedNumbers.OpaqueNumber","text":"abstract type OpaqueNumber{T<:Number} end\n\nSuper-type for numbers that do not have an accessible value, for example traced or symbolic numbers.\n\n\n\n\n\n","category":"type"},{"location":"api/#NestedNumbers.QuantityNumber","page":"API","title":"NestedNumbers.QuantityNumber","text":"abstract type QuantityNumber{T<:Number} <: NestedNumber{T} end\n\nRead as \"maybe static Integer\", an `Integ Super-type for number-like quantities (e.g. numbers with units).\n\n\n\n\n\n","category":"type"},{"location":"api/#NestedNumbers.RemoteNumber","page":"API","title":"NestedNumbers.RemoteNumber","text":"abstract type RemoteNumber{T<:Number} end\n\nSuper-type for numbers that are physically stored on another system or device, so that accessing the value may take time.\n\n\n\n\n\n","category":"type"},{"location":"api/#NestedNumbers.ABool","page":"API","title":"NestedNumbers.ABool","text":"const ABool = Union{Bool, BareNumber{Bool}}\n\nRead as \"almost Bool\", a Bool or NestedNumber{Bool}.\n\n\n\n\n\n","category":"type"},{"location":"api/#NestedNumbers.AComplex","page":"API","title":"NestedNumbers.AComplex","text":"const AComplex{T<:Real} = Union{Complex{T}, BareNumber{Complex{T}}}\n\nRead as \"almost Complex\", a Complex or BareNumber{<:Complex}.\n\n\n\n\n\n","category":"type"},{"location":"api/#NestedNumbers.AInteger","page":"API","title":"NestedNumbers.AInteger","text":"const AInteger{T<:Integer} = Union{T, BareNumber{T}}\n\nRead as \"almost Integer\", an Integer or NestedNumber{<:Integer}.\n\n\n\n\n\n","category":"type"},{"location":"api/#NestedNumbers.AReal","page":"API","title":"NestedNumbers.AReal","text":"const AReal{T<:Real} = Union{T, BareNumber{T}}\n\nReal as \"almost Real\", a Real or NestedNumber{<:Real}.\n\n\n\n\n\n","category":"type"},{"location":"api/#NestedNumbers.QBool","page":"API","title":"NestedNumbers.QBool","text":"const QBool = Union{Bool, BareNumber{Bool}, QuantityNumber{Bool}, QuantityNumber{<:BareNumber{Bool}}}\n\nRead as \"boolean or boolean-valued quantity\", a Bool or QuantityNumber{Bool}.\n\n\n\n\n\n","category":"type"},{"location":"api/#NestedNumbers.QComplex","page":"API","title":"NestedNumbers.QComplex","text":"const QComplex{T<:Real} = Union{Complex{T}, BareNumber{Complex{T}}, QuantityNumber{Complex{T}}, QuantityNumber{<:BareNumber{Complex{T}}}}\n\nRead as \"complex or complex-valued quantity\", a Complex or QuantityNumber{<:Complex}.\n\n\n\n\n\n","category":"type"},{"location":"api/#NestedNumbers.QInteger","page":"API","title":"NestedNumbers.QInteger","text":"const QInteger{T<:Integer} = Union{T, BareNumber{T}, QuantityNumber{T}, QuantityNumber{<:BareNumber{T}}}\n\nRead as \"integer or integer-valued quantity\", an Integer or QuantityNumber{<:Integer}.\n\n\n\n\n\n","category":"type"},{"location":"api/#NestedNumbers.QReal","page":"API","title":"NestedNumbers.QReal","text":"const QReal{T<:Real} = Union{T, BareNumber{T}, QuantityNumber{T}, QuantityNumber{<:BareNumber{T}}}\n\nRead as \"real number or real-valued quantity\", a Real or QuantityNumber{<:Real}.\n\n\n\n\n\n","category":"type"},{"location":"LICENSE/#LICENSE","page":"LICENSE","title":"LICENSE","text":"using Markdown\nMarkdown.parse_file(joinpath(@__DIR__, \"..\", \"..\", \"LICENSE.md\"))","category":"section"},{"location":"#NestedNumbers.jl","page":"Home","title":"NestedNumbers.jl","text":"","category":"section"}]
